import React from "react";
import Sidebar from "../components/sidebar";

export default class Project extends React.Component {
  render() {
    return (
      <div className="container-fluid">
        <div className="row">
          <Sidebar />
          <div className="col-sm-9 whiteCarryover">
            <div className="container-fluid">
              <h1 style={{ borderBottom: "2px yellow solid" }}>
                {this.props.heading}
              </h1>
              <p1 style={{ color: "#373737" }}>{this.props.intro}</p1>
              <br />
              <br />
              <h1 style={{ borderBottom: "2px #78C3FB solid" }}>
                Challenges faced
              </h1>
              <br />
              <p1 style={{ color: "#373737" }}>{this.props.challenges}</p1>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
